import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [files, setFiles] = useState([]);
  const [loading, setLoading] = useState(false);
  const [orderData, setOrderData] = useState({
    koNumber: '',
    orderDate: '',
    assignment: '',
    confirmationDate: ''
  });

  const handleFileChange = (e) => {
    const fileArray = Array.from(e.target.files).sort((a, b) => 
      a.name.localeCompare(b.name)
    );
    setFiles(fileArray);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setOrderData(prev => ({
      ...prev,
      [name]: value
    }));
  };


  const handleUpload = async () => {
    try {
      if (files.length === 0) {
        alert('Pilih file terlebih dahulu');
        return;
      }

      setLoading(true);
      const formData = new FormData();

      // Validasi tipe file
      for (const file of files) {
        if (!file.type.startsWith('image/')) {
          alert('Hanya file gambar yang diperbolehkan');
          return;
        }
        formData.append('images', file);
      }

      const response = await axios.post('http://localhost:3001/convert', formData, {
        responseType: 'blob',
        headers: {
          'Content-Type': 'multipart/form-data'
        }
      });

      if (response.data.size === 0) {
        throw new Error('PDF kosong');
      }

      const url = window.URL.createObjectURL(new Blob([response.data]));
      const link = document.createElement('a');
      link.href = url;
      link.setAttribute('download', 'converted.pdf');
      document.body.appendChild(link);
      link.click();
      link.remove();
      window.URL.revokeObjectURL(url);
    } catch (error) {
      console.error('Error:', error);
      alert('Terjadi kesalahan saat mengkonversi file');
    } finally {
      setLoading(false);
    }
  };


  return (
    <div className="container mx-auto p-4">
      <h1 className="text-2xl font-bold mb-4">Image to PDF Converter</h1>

      <div className="grid grid-cols-2 gap-4 mb-6">
        <div>
          <label className="block mb-2">Nomor KO:</label>
          <input
            type="text"
            name="koNumber"
            value={orderData.koNumber}
            onChange={handleInputChange}
            className="border p-2 w-full"
            placeholder="0060/KO/AZ/IV/2024"
          />
        </div>
        <div>
          <label className="block mb-2">Tanggal KO:</label>
          <input
            type="date"
            name="orderDate"
            value={orderData.orderDate}
            onChange={handleInputChange}
            className="border p-2 w-full"
          />
        </div>
        <div>
          <label className="block mb-2">Penugasan:</label>
          <input
            type="text"
            name="assignment"
            value={orderData.assignment}
            onChange={handleInputChange}
            className="border p-2 w-full"
            placeholder="Internal Web"
          />
        </div>
        <div>
          <label className="block mb-2">Tanggal Konfirmasi:</label>
          <input
            type="date"
            name="confirmationDate"
            value={orderData.confirmationDate}
            onChange={handleInputChange}
            className="border p-2 w-full"
          />
        </div>
      </div>

      {files.length > 0 && (
        <div className="mb-4">
          <h2 className="text-lg font-semibold mb-2">Selected Files:</h2>
          <ul className="list-disc pl-5">
            {files.map((file, index) => (
              <li key={index}>{file.name}</li>
            ))}
          </ul>
        </div>
      )}

      <button
        onClick={handleUpload}
        disabled={loading || files.length === 0}
        className="bg-blue-500 text-white px-4 py-2 rounded disabled:bg-gray-400"
      >
        {loading ? 'Converting...' : 'Convert to PDF'}
      </button>
    </div>
  );
}

export default App;
